import { Box, TextField } from "@mui/material";
import theme from "./theme";

export function TextEntry() {
  return (
    <Box
      sx={{
        marginTop: "2.5%",
        width: "50%",
      }}
    >
      <TextField
        fullWidth
        label="Ask Me A Question!"
        variant="outlined"
      ></TextField>
    </Box>
  );
}
